import React, { Component } from 'react'
import { Typography } from '@material-ui/core';
import './RequestDetail.css'
import Description from './Components/Description'

interface Idata{
    title?: string,
    teacher?: string,
    scienceArea?: string,
    description?: string,
    teacherContacts?: string,
    aboutMe?: string,
    id?: number
}

interface Props{
    data : Idata
}

interface State{

}

class RequestDetail extends Component<Props,State>{
    constructor(props : Props){
        super(props);
        this.state={}
    }

    private renderRequestDetail(){
        return(
            <div>
                <div className='requestTitle'><Typography variant='h4'>{this.props.data.title}</Typography></div>
                <Description data={this.props.data}/>
                <div className='aboutMeDiv'>
                    <Typography variant='h6'>Мое резюме:</Typography>
                    <div className=''><Typography>{this.props.data.aboutMe}</Typography></div>
                </div>
            </div>
        )
    }

    render(){
        return this.renderRequestDetail();
    }
}

export default RequestDetail
